import React, { useState } from 'react';
import './App.css';
import MapGL, { GeolocateControl } from 'mapbox-gl';
// import Root from './component/map/map';

const MAPBOX_TOKEN =
	'pk.eyJ1IjoiYm95cGVyZmVyIiwiYSI6ImNrOGF5aGRybDAzOGcza293NXI0OGNodTAifQ.k1EdkowgT451b0uqW-kQHw';

const geolocateStyle = {
	float: 'left',
	margin: '50px',
	padding: '10px'
};

function App() {
	const [viewPort, setViewPort] = useState({
		latitude: 37.8,
		longitude: -122.4,
		zoom: 14,
		bearing: 0,
		pitch: 0
	});

	return (
		<div>
			<MapGL
				{...viewPort}
				width='100vw'
				height='100vh'
				mapStyle='mapbox://styles/mapbox/dark-v9'
				onViewportChange={setViewPort}
				mapboxApiAccessToken={MAPBOX_TOKEN}
			></MapGL>
		</div>
	);
}

export default App;
